import PopupWithForm from "./PopupWithForm"

const InfoTooltip = (props) => {
	const handleSubmit = (e) => {
		e.preventDefault()
	}
	console.log(props)
	return (
		<>
			<PopupWithForm
				isOpen={props.isOpen}
				onClose={props.onClose}
				onSubmit={handleSubmit}
			/>
		</>
	)
}

export default InfoTooltip
